import React from 'react';
import { motion } from 'framer-motion';

const Skills = () => {
  const skills = [
    { name: "React Development", icon: "笞幢ｸ十

from-indigo-500 to-purple-600" },
    { name: "Creative Design", icon: "笨ｨ", level: 90, color: "from-pink-500 to-rose-600" }
  ];

  return (
    <section className="py-20 px-4 relative overflow-hidden">
      {/* Gaming Background */}
      <div className="absolute inset-0">
        {[...Array(15)].map((_, i) => (
          <motion.div
            key={i}
            className="absolute rounded-full"
            style={{
              width: `${Math.random() * 100 + 30}px`,
              height: `${Math.random() * 100 + 30}px`,
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              background: `radial-gradient(circle, ${[
                'rgba(0, 255, 255, 0.1)',
                'rgba(0, 128, 255, 0.1)',
                'rgba(128, 0, 255, 0.1)'
              ][Math.floor(Math.random() * 3)]} 0%, transparent 70%)`,
            }}
            animate={{
              y: [-20, 20, -20],
              x: [-15, 15, -15],
              scale: [1, 1.1, 1],
            }}
            transition={{
              duration: 8 + Math.random() * 4,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          />
        ))}
      </div>

      <div className="max-w-6xl mx-auto relative z-10">
        <motion.h2 
          className="text-6xl md:text-8xl font-black text-center mb-20"
          initial={{ opacity: 0, y: 100 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 1.5 }}
          viewport={{ once: true }}
        >
          <span className="text-gaming-gradient hover-glow">
            Skills & Expertise
          </span>
        </motion.h2>

        <div className="grid md:grid-cols-2 lg:grid-cols-4 gap-8">
          {skills.map((skill, index) => (
            <motion.div
              key={skill.name}
              className="gaming-card hover-gaming p-8 rounded-2xl backdrop-blur-xl transform-gpu"
              initial={{ opacity: 0, y: 50, rotateX: -30 }}
              whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
              transition={{ delay: index * 0.1, duration: 0.8 }}
              viewport={{ once: true }}
              whileHover={{ 
                scale: 1.1,
                rotateY: 10,
                rotateX: 5,
                boxShadow: "0 30px 80px rgba(0, 255, 255, 0.4), 0 0 100px rgba(0, 128, 255, 0.3)"
              }}
            >
              {/* Skill Icon */}
              <motion.div
                className="text-6xl mb-6 text-center"
                whileHover={{ scale: 1.4, rotate: 15 }}
                transition={{ duration: 0.3 }}
              >
                {skill.icon}
              </motion.div>

              {/* Skill Name */}
              <h3 className="text-xl font-bold text-center mb-6 text-gaming-gradient hover-glow">
                {skill.name}
              </h3>

              {/* Progress Bar */}
              <div className="relative">
                <div className="w-full bg-gray-800/50 rounded-full h-3 mb-2">
                  <motion.div
                    className={`h-3 rounded-full bg-gradient-to-r ${skill.color}`}
                    initial={{ width: 0 }}
                    whileInView={{ width: `${skill.level}%` }}
                    transition={{ delay: index * 0.1 + 0.5, duration: 1, ease: "easeOut" }}
                    viewport={{ once: true }}
                  />
                </div>

                {/* Percentage */}
                <motion.span
                  className="text-sm text-cyan-400 font-medium hover-glow"
                  initial={{ opacity: 0 }}
                  whileInView={{ opacity: 1 }}
                  transition={{ delay: index * 0.1 + 1, duration: 0.5 }}
                  viewport={{ once: true }}
                >
                  {skill.level}%
                </motion.span>
              </div>

              {/* Hover glow effect */}
              <motion.div
                className={`absolute inset-0 bg-gradient-to-r ${skill.color} rounded-xl opacity-0 group-hover:opacity-10 transition-opacity duration-300 -z-10`}
                whileHover={{ scale: 1.1 }}
              />
            </motion.div>
          ))}
        </div>

        {/* Additional Skills Categories */}
        <motion.div
          className="mt-16 grid md:grid-cols-3 gap-8"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.5, duration: 0.8 }}
          viewport={{ once: true }}
        >
          {[
            {
              title: "Development & Programming",
              items: ["React.js", "Node.js", "JavaScript ES6+", "Mobile Apps", "Web Development", "API Integration"],
              color: "from-cyan-500 to-blue-600"
            },
            {
              title: "Content Creation & Gaming",
              items: ["YouTube Content", "Video Editing", "Gaming Streams", "Social Media", "Community Building"],
              color: "from-purple-500 to-pink-600"
            },
            {
              title: "Design & Creative Skills",
              items: ["UI/UX Design", "Graphic Design", "Brand Identity", "Creative Direction", "Visual Storytelling"],
              color: "from-indigo-500 to-purple-600"
            }
          ].map((category, index) => (
            <motion.div
              key={category.title}
              className="gaming-card hover-gaming p-6 rounded-xl backdrop-blur-xl"
              whileHover={{ scale: 1.02 }}
              transition={{ duration: 0.3 }}
            >
              <h3 className={`text-xl font-semibold mb-4 bg-gradient-to-r ${category.color} bg-clip-text text-transparent hover-glow`}>
                {category.title}
              </h3>
              <div className="flex flex-wrap gap-2">
                {category.items.map((item, itemIndex) => (
                  <motion.span
                    key={item}
                    className="px-3 py-1 bg-cyan-500/20 text-cyan-300 rounded-full text-sm hover:bg-cyan-500/30 hover:text-cyan-100 transition-colors cursor-default border border-cyan-500/30 hover-glow"
                    initial={{ opacity: 0, scale: 0.8 }}
                    whileInView={{ opacity: 1, scale: 1 }}
                    transition={{ delay: index * 0.1 + itemIndex * 0.05, duration: 0.3 }}
                    viewport={{ once: true }}
                    whileHover={{ scale: 1.1 }}
                  >
                    {item}
                  </motion.span>
                ))}
              </div>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default Skills;
